import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import contacts from './data/contacts.json';
import index from './index';
import Actors from './components/Actors'

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Ironcontcats</h1>
        <ul>
          <Actors />
        </ul>
      </div>
    );
  }
}

export default App;
